"use strict";
var app = window.app = Ember.Application.create({
    // Application Constructor
    initialize: function() {
        document.addEventListener('deviceready', this.onDeviceReady, false);
    },

    db : null,

    max : 0,

    onDeviceReady: function() {
        var db = sqlitePlugin.openDatabase({name: "my.db", key: "your-password-here"});

        db.transaction(function(tx) {
            tx.executeSql('DROP TABLE IF EXISTS test_table');
        });
        app.set('db', db);
    },
    doTimeout : function() {
        this.set('max', 40);
        this.doStuff();
    },
    doTombstone : function() {
        this.set('max', 100);
        this.doStuff();
    },
    doStuff : function() {
        var db = app.get('db'),
            i, data = [], base64Image = "data:image/jpeg;base64,",
            number = 1261235612536,
            dataChunk =
            {"image1" : base64Image,
                "image2" : base64Image,
                "image3" : base64Image,
                "image4" : base64Image,
                "number" : number},
            max = this.get('max');

        for(i=0;i<max;i++) {
            data.push(dataChunk);
            console.log("building test data " + i + " of " + max);
        }
        data.forEach(function() {
            db.transaction(function (tx) {
                tx.executeSql('CREATE TABLE IF NOT EXISTS test_table (id integer primary key, image1 text, image2 text, image3 text, image4 text, data_num integer)', [], function () {
                    data.forEach(function (
                        item,
                        index
                    ) {
                        tx.executeSql("INSERT INTO test_table (image1, image2, image3, image4, data_num) VALUES (?,?,?,?,?)", [item.image1, item.image2, item.image3, item.image4, item.number], function (
                            tx,
                            res
                        ) {

                            db.transaction(function (tx) {
                                tx.executeSql("UPDATE test_table SET data_num = ? WHERE data_num = ?", [1, dataChunk.number], function (
                                    tx,
                                    res
                                ) {
                                    //console.log("updating stuff");
                                }, function (e) {
                                    console.log("ERROR: ", e);
                                });
                            });

                        }, function (e) {
                            console.log("ERROR: ", e);
                        });
                    });
                }, function (e) {
                    console.log("ERROR: ", e);
                });
            });
        });
    }
});

app.initialize();